Function.prototype.myapply = function(context, arr) {
  var context = Object(context) || window;
  context.fn = this;

  var result;
  if (!arr) {
    result = context.fn();
  } else {
    var args = [];
    for (var i = 0, len = arr.length; i < len; i++) {
      args.push("arr[" + i + "]");
    }
    result = eval("context.fn(" + args.join(',') + ")");
  }

  delete context.fn;
  return result;
};

Function.prototype.myCall = function(context) {
  context.fn = this
  let args = Array.prototype.slice(arguments, 1)
  let result = context.fn(...args)
  delete context.fn
  return result
}

const instance_of = (left, right) => {
    if(!left || !right) return;
    const rightPrototype = right.prototype
    while (left = Object.getPrototypeOf(left)) {
        if(left === rightPrototype) return true
    }
    return false
}

const jsonp =  (url, params, callback) => {
    let fullUrl = url + '?' +  Object.entries(params).map(([key,value]) => `${key}=${value}`).join('&') + `&callback=${callback}`

    return new Promise((resolve,reject) => {
        let script = document.createElement('script')
        script.src=fullUrl
        document.body.appendChild(script)
        window[callback] = (data) => {
            resolve(data)
            document.body.removeChild(script)
        }
    })
}

const flat1 = (arr, num = 1) => {
    if(!Array.isArray(arr)) return
    return arr.flat(num)
}

const flat2 = (arr) => {
    if (!Array.isArray(arr)) return
    return arr.reduce((a,b) => a.concat(Array.isArray(b) ? flat2(b) : b), [])
}

const flat3 = (arr) => {
    if (!Array.isArray(arr)) return
    const stack = [...arr]
    const res = []
    while (stack.length) {
        let value = stack.shift()
        Array.isArray(value) ? stack.push(...value) : res.push(value)
    }
    return res
}

