const curry = (fn) => {
  let params = []
  const next = (...args) => {
    params = [...params, ...args]
    // fn.length‰ª£Ë°®ÁùÄÂèÇÊï∞ÁöÑÊï∞Èáè
    if (params.length < fn.length) {
      return next
    } else {
      return fn.apply(fn, params)
    }
  }

  return next
}

